INSERT INTO `ol_paketumroh` (`idpaketumroh`, `nmpaketumroh`, `imgpaketumroh`, `hrgdouble`, `hrgtripple`, `hrgquad`, `overview`, `rincian`, `termasuk`, `tdktermasuk`, `pandp`, `moreinfo`, `itinerary`) VALUES
(1, 'Umroh Exclusive 9 Hari', 'series.jpg', 3800000, 3600000, 3400000, '<ul>\n    <li>3 Malam Madinah, 4 Malam Makkah</li>\n    <li>Grand Mercure Hotel Madinah</li>\n    <li>Fairmout Hotel Makkah</li>\n    <li>Makan Full Board Hotel</li>\n    <li>Saudia Airlines</li>\n</ul>', '<div class="row">\r\n    <div class="col-md-3">\r\n        <img class="img-responsive img-blog" src="<?php echo base_url()?>asset/images/umrah/itin/day1.jpg" width="100%" alt="umroh, paket umroh, paket Umroh bulan 2018 2019 pt dream tour and travel" />\r\n    </div>\r\n    <div class="col-md-9">\r\n        <b>Hari ke-1  : JAKARTA  MADINAH<br></b>\r\n        Berkumpul di Bandara International Soekarno Hatta, Jakarta 3 (tiga) jam sebelum keberangkatan untuk penerbangan dari Jakarta menuju Madinah. Setibanya di Bandara Prince Mohammed Bin Abdul Aziz Madinah, jamaah langsung di antar menuju Hotel. Tiba di Hotel Grand Mercure Madinah untuk  berisitirahat.<br><br>\r\n    </div>\r\n</div>\r\n<hr>\r\n<div class="row">\r\n    <div class="col-md-3">\r\n        <img class="img-responsive img-blog" src="<?php echo base_url()?>asset/images/umrah/itin/day2.jpg" width="100%" alt="umroh, paket umroh, paket Umroh bulan 2018 2019 pt dream tour and travel" />\r\n    </div>\r\n    <div class="col-md-9">\r\n        <b>Hari ke-2 : MADINAH<br></b>\r\n       Setelah Sarapan Pagi, Acara Bebas dengan Memperbanyak Ibadah di Masjid Nabawi, Sore Hari Jamaah akan Diajak Mengunjungi Museum Asmaul Husna Serta Maqam Baqi yang Berlokasi di Area Masjid Nabawi, Setelah Sholat Isya dan Makan Malam,  berziarah ke Makam Rasullulah SAW & Para Sahabat dengan di dampingi Mutawif wanita dan laki  laki kemudian melaksanakan shalat sunah dan berdoa di Raudah. Setelah itu memperbanyak Ibadah di Masjid Nabawi. (Free Program).<br><br>\r\n    </div>\r\n</div>\r\n<hr>\r\n<div class="row">\r\n    <div class="col-md-3">\r\n        <img class="img-responsive img-blog" src="<?php echo base_url()?>asset/images/umrah/itin/day3.jpg" width="100%" alt="umroh, paket umroh, paket Umroh bulan 2018 2019 pt dream tour and travel" />\r\n    </div>\r\n    <div class="col-md-9">\r\n        <b>Hari ke-3 : MADINAH<br></b>\r\n        Setelah sarapan persiapan untuk Ziarah Kota Madinah. Ziarah mengunjungi Jabal Uhud, Masjid Quba dan Pasar Kurma. Setelah itu kembali ke hotel dan kembali memperbanyak ibadah di Masjid Nabawi. <br><br>\r\n    </div>\r\n</div>\r\n<hr>\r\n<div class="row">\r\n    <div class="col-md-3">\r\n        <img class="img-responsive img-blog" src="<?php echo base_url()?>asset/images/umrah/itin/day4.jpg" width="100%" alt="umroh, paket umroh, paket Umroh bulan 2018 2019 pt dream tour and travel" />\r\n    </div>\r\n    <div class="col-md-9">\r\n        <b>Hari ke-4 : MADINAH  MAKKAH<br></b>\r\n       Setelah Sarapan Pagi, Mandi Sunah ikhram dan persiapan untuk cek out. Setelah Sholat Dzuhur dan Makan Siang persiapan berangkat menuju ke Makkah dan mengambil Miqot di Biir Ali / Masjid Syajarah. Tiba di Makkah, langsung ke Hotel Fairmont Makkah untuk menyimpan barang-barang dan makan malam, kemudian melaksanakan ibadah Umroh. Setelah ibadah umroh selesai jamaah kembali ke hotel untuk beristirahat.  <br><br>\r\n    </div>\r\n</div> \r\n<hr>\r\n<div class="row">\r\n    <div class="col-md-3">\r\n        <img class="img-responsive img-blog" src="<?php echo base_url()?>asset/images/umrah/itin/day5.jpg" width="100%" alt="umroh, paket umroh, paket Umroh bulan 2018 2019 pt dream tour and travel" />\r\n    </div>\r\n    <div class="col-md-9">\r\n        <b>Hari ke-5 : MAKKAH<br></b>\r\n      Setelah sarapan pagi, Acara Bebas dengan Memperbanyak Ibadah di Masjidil Haram.  <br><br>\r\n    </div>\r\n</div>\r\n<hr>\r\n<div class="row">\r\n    <div class="col-md-3">\r\n        <img class="img-responsive img-blog" src="<?php echo base_url()?>asset/images/umrah/itin/day6.jpg" width="100%" alt="umroh, paket umroh, paket Umroh bulan 2018 2019 pt dream tour and travel" />\r\n    </div>\r\n    <div class="col-md-9">\r\n        <b>Hari ke-6 : MAKKAH<br></b>\r\n        Setelah sarapan pagi, persiapan Ziarah Kota Makkah. Ziarah mengunjungi Padang Arafah, Jabal Rahmah, Muzdalifah, Mina dan Jabal Tsur. Kemudian berakhir di Jaronah (bagi yang akan melaksanakan umroh kedua Silahkan  untuk mengambil miqot) bagi yang tidak mengikuti umrah kedua memperbanyak Ibadah di Masjidil Haram. <br><br>\r\n    </div>\r\n</div>\r\n<hr>\r\n<div class="row">\r\n    <div class="col-md-3">\r\n        <img class="img-responsive img-blog" src="<?php echo base_url()?>asset/images/umrah/itin/day7.jpg" width="100%" alt="uumroh, paket umroh, paket Umroh bulan 2018 2019 pt dream tour and travel" />\r\n    </div>\r\n    <div class="col-md-9">\r\n        <b>Hari ke-7 : MAKKAH<br></b>\r\n        Memperbanyak ibadah di Masjidil Haram. (Free Program). <br><br>\r\n    </div>\r\n</div>  \r\n<hr>\r\n<div class="row">\r\n    <div class="col-md-3">\r\n        <img class="img-responsive img-blog" src="<?php echo base_url()?>asset/images/umrah/itin/day8.jpg" width="100%" alt="umroh, paket umroh, paket Umroh bulan 2018 2019 pt dream tour and travel" />\r\n    </div>\r\n    <div class="col-md-9">\r\n        <b>Hari ke-8  : MAKKAH  JEDDAH<br></b>\r\n        Setelah Sholat Subuh dan Thawaf Wada persiapan untuk cek out hotel. Jamaah bertolak menuju Jeddah dan City Tour, Mengunjungi Masjid Terapung ( Masjid Ar Rahmah ), Corniche, Masjid Qishash dan Makam Siti Hawa, dan Makan Siang di Restaurant Batavia Jeddah kemudian Setelah itu 4 jam sebelum take off jamaah menuju airport Jeddah untuk keberangkatan ke Jakarta. <br><br>\r\n    </div>\r\n</div>  \r\n<hr>\r\n<div class="row">\r\n    <div class="col-md-3">\r\n        <img class="img-responsive img-blog" src="<?php echo base_url()?>asset/images/umrah/itin/day9.jpg" width="100%" alt="umroh, paket umroh, paket Umroh bulan 2018 2019 pt dream tour and travel" />\r\n    </div>\r\n    <div class="col-md-9">\r\n        <b>Hari ke-9 : JAKARTA<br></b>\r\n        Tiba di Jakarta dan Insha Allah membawa Umrah Maqbullah dan kenangan yang indah bersama Dream Tour. Terimakasih atas keikutsertaan anda dalam memilih DREAM TOUR sebagai teman perjalananan Ibadah Umroh anda. Sampai bertemu kembali di Acara Tour yang lain.<br><br>\r\n    </div>\r\n</div>  \r\n<hr>', '<p>\r\n    - Tiket Pesawat PP : Jakarta - Madinah/Jeddah - Jakarta by Saudi Airlines<br>\r\n    - Akomodasi / Hotel sesuai program ( 03 Malam Madinah + 04 Malam Makkah )<br>\r\n    - Driver & Transportasi ( 49 Seater )  Saptco Mercy Travego 2017, untuk Ziarah, Tours, dan Transfers di Saudi Arabia<br>\r\n    - Makan/minum 3X sehari di masing  masing Hotel ( Fullboard Hotel )  selama di Saudi Arabia sesuai program<br>\r\n    - Muthawwif atau Pembimbing Ibadah berbahasa Indonesia<br>\r\n    - Air Zamzam@ 5Liter perJamaah<br>\r\n    - Visa Umroh<br>\r\n\r\n</p>', '<p>\r\n    - Perlengkapan Umroh, Lounge Bandara, Fast Track Imigasi Bandara Soekarno Hatta Jakarta, Asuransi Perjalanan Umroh dan Manasik Umroh Sebesar Rp. 1.500.000<br>\r\n    - Kelebihan Bagasi sesuai Ketentuan Penerbangan<br>\r\n    - Tour/Makan/Minum tambahan diluar program<br>\r\n    - Telephone Bill, Payview TV, Mini Bar, dan semua pemakaian fasilitas/layanan di hotel <br>\r\n    - Biaya-biaya yang bersifat pribadi, dan atau yang bukan merupakan fasilitas program<br>\r\n    - Biaya Visa ( Progresive ) <br>\r\n\r\n</p>', '<p>\r\n    - Paspor Asli dengan masa berlaku tidak kurang dari 10 Bulan sebelum Jadwal Keberangkatan.<br>\r\n    - Nama di Paspor minimal 3 (tiga) kata, contoh : Muhammad Ali Akbar<br>\r\n    - Pas Foto 4X 6 Berwarna background Putih dengan focus wajah 80% sebanyak 6 (enam) lembar<br>\r\n    - Photo copy Akte Lahir untuk Peserta Anak<br>\r\n    - Photo copy Kartu Keluarga (KK) dan Buku Nikah bagi Suami Istri<br>\r\n    - Photo copy Kartu Keluarga (KK) Orangtua<br>\r\n    - Kartu Kuning Suntik Meningitis Asli<br>\r\n    - Pendaftaran disertai dengan Deposit minimum IDR 15.000.000,  dengan pelunasan biaya paket maksimal 2 (dua) minggu sebelum Jadwal Keberangkatan<br>\r\n    \r\n</p>', '<p>\r\n    PT Dream Tours & Travel telah membuka pendaftaran <b>Paket Umroh Periode Oktober 2018 - Mei 2019</b> dengan keberangkatan  selama 9 Hari 8 malam. <b>Paket Umroh Exclusive 9 Hari</b> ini merupakan Produk Unggulan kami. <br><br>\r\n    Anda akan diajak mengelilingi indahnya Kota Jeddah, Mekkah, dan Madinah pada <b>Paket Umroh Exclusive 9 Hari</b> ini. Anda akan mengunjungi Masjid Nabawi, Masjid Quba, Pasar Kurma, Jabal Uhud, Bir Ali, Jabal Tsur, Jabal Rahmah, dan Ji''ronah. <br><br>\r\n    Perlu diketahui, Makkah adalah Kota berkumpulnya Seluruh Umat Islam untuk menunaikan Ibadah Umrah dan Haji. Kota yang memiliki <b>luas 850 km2</b> ini memiliki mata uang bernama <b>Arab Saudi Riyal (SAR).</b> Bila dikonversikan ke Rupiah, <b>1 SAR</b> setara dengan <b> Rp 3.700 .</b><br><br>\r\n    Makkah memiliki iklim yang tak menentu. Temperatur tertinggi yang pernah tercatat di Makkah adalah 49,8 C dan paling rendah 10 C.\r\n    Harga <b>Paket Umroh </b> kami sudah termasuk pembuatan Visa Umroh, Tiket Pesawat P/P Jakarta  Madinah/Jeddah  Jakarta, Akomodasi / Hotel Sesuai Program, Mutawwif / Pembimbing di Arab Saudi.\r\n</p>', 'umroh_dreamtour_1440.pdf');
