INSERT INTO `tb_tour_detail` (`id_tour_detail`, `id_tour`, `gambar_detail`, `id_itinerary`, `include`, `exclude`, `term`, `highlight`) VALUES
(1, 1, 'indo_pari.jpg', 1, '- Akomodasi PP<br>\n- Penginapan AC<br>\n- Makan 3x<br>\n- Tiket Masuk Pantai Perawan', '- Perlengkapan Pribadi', '- Min 2 Pax', 'Pulau Pari adalah salah satu gugusan kepulauan di Kepulauan Seribu'),
(2, 2, 'indo_tidung.jpg', 2, '- Akomodasi Tiket Fery Muara Angke - Pulau Tidung<br>\n- Penginapan AC<br>\n- Alat Snorkeling<br>\n- Underwater Foto<br>\n- Tour Guide', '- Perlengkapan Pribadi', '- Minimal 2 Pax', 'Pulau Tidung adalah salah satu Pulau Indah yang berada di Kepulauan Seribu, Jakarta, Utara'),
(3, 3, 'indo_harapan.jpg', 3, '- Akomodasi Kapal Muara Angke - Harapan (PP)<br>\n- Homestay AC<br>\n- Makan 3x<br>\n- BBQ<br>\n- Alat Snorkeling<br>\n- Underwater Photo <br>\n- Kapal Jelajah Pulau<br>\n- Guide Lokal', '- Perlengkapan Pribadi', '- Min 2 Pax', 'Pulau Harapan adalah salah satu Pulau Indah yang berada di Kepulauan Seribu, Jakarta, Utara'),
(4, 4, 'indo_bandung.jpg', 4, '- Transportasi AC Jakarta-Bandung(PP)<br>\n- Tour Leader<br>\n- Tiket Objek Wisata<br>\n- Makan Siang(1x)\n- Parkir, Retribusi, Tol', '-', '-', 'Kota Bandung merupakan kota metropolitan terbesar di Jawa Barat sekaligus menjadi ibu kota provinsi tersebut.'),
(5, 5, 'indo_sumbar.jpg', 5, '- Transport<br>\n- Hotel<br>\n- Makan (4x)<br>\n- Tour Guide', '-', '-', 'Sumatera Barat adalah salah satu provinsi di Indonesia yang terletak di pulau Sumatera dengan Padang sebagai ibu kotanya'),
(6, 6, 'indo_sumut.jpg', 6, '- Transportasi AC<br>\n- Tiket Pesawat PP<br>\n- Airport Tax<br>\n- Makan sesuai Program<br>\n- Tour Leader', '- ', '-', 'Sumatera Utara adalah sebuah provinsi yang terletak di Pulau Sumatera, Indonesia dan beribukota di Medan'),
(7, 7, 'indo_bali.jpg', 7, '- Tiket Pesawat PP<br>\n- Hotel<br>\n- Mobil + Supir + BBM<br>\n- Tiket Masuk Objek Wisata', '- Tips<br>\n- Keperluan Pribadi', '-', 'Bali adalah nama salah satu provinsi di Indonesia dan juga merupakan nama pulau terbesar yang menjadi bagian dari provinsi tersebut.'),
(8, 8, 'indo_jogja.jpg', 8, '- Tiket Pesawat PP<br>\n- Transportasi AC<br>\n- Hotel<br>\n- Tiket Masuk Objek Wisata<br>\n- Tour Leader', '-', '-', 'Daerah Istimewa Yogyakarta adalah Daerah Istimewa setingkat provinsi di Indonesia yang merupakan peleburan Negara Kesultanan Yogyakarta dan Negara Kadipaten Paku Alaman.'),
(9, 9, 'indo_lombok.jpg', 9, '- Tiket Pesawat + Airport Tax<br>\n- Transportasi AC<br>\n- Boat menuju dan dari Gili Trawangan<br>\n- Tiket Objek Wisata', '-', '-', 'Pulau Lombok adalah sebuah pulau di kepulauan Sunda Kecil atau Nusa Tenggara yang terpisahkan oleh Selat Lombok dari Bali di sebelat barat dan Selat Alas di sebelah timur dari Sumbawa.'),
(10, 10, 'indo_anyer.jpg', 10, '- Transportasi AC<br>\n- Hotel<br>\n- Fun Games<br>\n- Tour Leader', '-', '-', 'Anyar atau anyer adalah nama sebuah kecamatan di Kabupaten Serang, Provinsi Banten, Indonesia. Kecamatan ini memiliki pantai yang sangat terkenal sebagai daerah pariwisata.'),
(11, 11, 'indo_pangandaran.jpg', 11, '- Transportasi AC<br>\n- Hotel<br>\n- Makan 5x<br>\n- Tiket Masuk Wisata<br>\n- Guide', '- Tips<br>\n- Pengeluaran Pribadi', '-', 'Pangandaran adalah sebuah kecamatan di Kabupaten Pangandaran, Provinsi Jawa Barat, Indonesia. Kecamatan ini terletak di bagian paling selatan kabupaten Pangandaran dan merupakan daerah wisata utama di Kabupaten Pangandaran.'),
(12, 12, 'indo_garut.jpg', 12, '- Transportasi AC<br>\n- Hotel<br>\n- Makan sesuai Program<br>\n- Tiket objek Wisata<br>\n- Tour Leader', '- Pengeluaran Pribadi', '-', 'Kabupaten Garut, adalah sebuah Kabupaten di Provinsi Jawa Barat, Indonesia. Ibukotanya adalah Tarogong Kidul.'),
(13, 13, 'indo-bromo.jpg', 13, '- Penginapan di Bromo dan Batu<br>\n- Transport<br>\n- Tiket Masuk Wisata<br>\n- Jeep di Bromo<br>\n- Guide Lokal', '- Makan Siang/Malam<br>\n- Sewa Kuda Bromo', '-', 'Gunung Bromo, merupakan gunung berapi yang masih aktif dan paling terkenal sebagai obyek wisata di Jawa Timur. Sebagai sebuah obyek wisata, Gunung Bromo menjadi menarik karena statusnya sebagai gunung berapi yang masih aktif.'),
(14, 14, 'indo-makassar.jpg', 14, '- Transportasi AC<br>\n- Hotel<br>\n- Makan sesuai Program<br>\n- Tiket objek wisata<br>\n- Guide Lokal', '-', '-', 'Kota Makassar adalah ibu kota provinsi Sulawesi Selatan. Makassar merupakan kota terbesar di kawasan Indonesia Timur dan wilayah metropolitan terbesar kedua di luar Pulau Jawa, setelah Kota Medan.'),
(15, 15, 'indo-weh.jpg', 15, '- Tiket Pesawat PP<br>\n- Tiket Kapal Cepat PP<br>\n- Transport<br>\n- Hotel<br>\n- Alat Snorkeling<br>\n- Underwater Kamera<br>\n- Sertifikat Nol Kilometer<br>\n- Guide Lokal', '- Makan dan Minum<br>\n- Porter Airport<br>\n- Tips', '-', 'Pulau Weh adalah pulau vulkanik kecil yang terletak di barat laut Pulau Sumatra. Pulau ini pernah terhubung dengan Pulau Sumatra, namun kemudian terpisah oleh laut setelah meletusnya gunung berapi terakhir kali pada zaman Pleistosen'),
(16, 16, 'indo_wakatobi.jpg', 16, '- Transportasi dan Hotel<br>\n- Boat Reguler<br>\n- Makan di Wakatobi<br>\n- Alat Snorkeling<br>\n- Barbeque<br>\n- Guide Lokal', '- Kapal Bau-Bau - Wakatobi<br>\n- Angkot dari pelabuhan<br>\n- Diving', '-', 'Kabupaten Wakatobi adalah salah satu kabupaten di Provinsi Sulawesi Tenggara, Indonesia. Ibu kota kabupaten ini terletak di Wangi-Wangi, dibentuk berdasarkan Undang-undang Republik Indonesia Nomor 29 Tahun 2003, tanggal 18 Desember 2003.'),
(17, 17, 'indo_derawan.jpg', 17, '- Transport<br>\n- Hotel<br>\n- Alat Snorkeling<br>\n- Tiket masuk wisata', '-', '-', 'Kepulauan Derawan adalah sebuah kepulauan yang berada di Kabupaten Berau, Kalimantan Timur. Di kepulauan ini terdapat sejumlah obyek wisata bahari menawan, salah satunya Taman Bawah Laut yang diminati '),
(18, 18, 'indo-bangka.jpg', 18, '- Tiket Pesawat PP<br>\n- Hotel<br>\n- Transport AC<br>\n- Guide<br>\n- Alat Snorkeling<br>\n- Boat', '-', '-', 'Belitung, atau Belitong, dulunya dikenal sebagai Billiton adalah sebuah pulau di lepas pantai timur Sumatra, Indonesia, diapit oleh Selat Gaspar dan Selat Karimata.'),
(19, 19, 'indo-bunaken.jpg', 19, '- Tiket Pesawat PP<br>\n- Hotel<br>\n- Guide<br>\n- Parkir<br>\n- Asuransi', '- Tips<br>\n- Sewa Alat Snorkeling', '-', 'Bunaken adalah sebuah pulau seluas 8,08 km di Teluk Manado, yang terletak di utara pulau Sulawesi, Indonesia. Pulau ini merupakan bagian dari kota Manado, ibu kota provinsi Sulawesi Utara, Indonesia'),
(20, 20, 'indo-komdo.jpg', 20, '- Hotel<br>\n- Tiket Pesawat PP<br>\n- Transport<br>\n- Private Boat<br>\n- Guide', '- Camera fee<br>\n- Asuransi', '-', 'Pulau Komodo adalah sebuah pulau yang terletak di Kepulauan Nusa Tenggara. Pulau Komodo dikenal sebagai habitat asli hewan komodo. Pulau ini juga merupakan kawasan Taman Nasional Komodo yang dikelola oleh Pemerintah Pusat.'),
(21, 21, 'indo_raja.jpg', 21, '- Hotel<br>\n- Transport PP<br>\n- Alat Snorkeling<br>\n- Speedboat', '- Diving', '-', 'Kepulauan Raja Ampat merupakan rangkaian empat gugusan pulau yang berdekatan dan berlokasi di barat bagian Kepala Burung Pulau Papua. Secara administrasi, gugusan ini berada di bawah Kabupaten Raja Ampat, Provinsi Papua Barat.'),
(22, 22, 'fe-spore.jpg', 22, '- Tiket Pesawat PP<br>\n- Hotel<br>\n- Breakfast', '- Airport Tax', '-', 'Singapura nama resminya Republik Singapura, adalah sebuah negara pulau di lepas ujung selatan Semenanjung Malaya, 137 kilometres di utara khatulistiwa di Asia Tenggara.'),
(23, 23, 'fe-malay.jpg', 23, '- Tiket Pesawat PP<br>\n- hotel<br>\n- Breakfast', '- Airport Tax', '-', 'Malaysia adalah sebuah negara federasi yang terdiri dari tiga belas negara bagian dan tiga wilayah persekutuan di Asia Tenggara dengan luas 329.847 km persegi. '),
(24, 33, 'honeymoon_turkey.jpg', 32, '-	Meet and assist upon arrival and departure <br>\n-	All Tour & transfer by Private Van <br>\n-	Entrance Fees to sites as program <br>\n-	English speaking Guide during tour in Turkey <br>\n-	6 nights hotel accommodation on HB Basis <br>\n-	7 Lunches en route + 1 Chinese Dinner in Istanbul <br>\n-	Extra breakfast upon arrival <br>\n-	1 bottle of water per person per day <br>\n-	Int. Flight with V class\n', '-	Visa <br>\n-	Tax, Airport Tax <br>\n-	Porterage at Airport & Hotel <br>\n-	Entrance to Harem Section at Tokapi Palace <br>\n-	Cable Car in Bursa : USD 25/pax <br>\n-	Hot Air Balloon in Cappadocia <br>\n-	Belly Dance & Show <br>\n-	Tips to local guide :$45/ group/ day <br>\n-	Tips to driver   : $30/group/day <br>\n', '-', 'Turkey, officially the Republic of Turkey, is a contiguous transcontinental parliamentary republic largely located in Western Asia with the portion of Eastern Thrace in Southeastern Europe.'),
(25, 24, 'fe-thai.jpg', 25, '- Tiket Pesawat PP<br>\n- Hotel<br>\n- Breakfast', '- Airport Tax', '-', 'Kerajaan Thai, yang lebih sering disebut Thailand dalam bahasa Inggris, atau dalam bahasa aslinya Mueang Thai, adalah sebuah negara di Asia Tenggara yang berbatasan dengan Laos dan Kamboja'),
(26, 34, 'honeymoon_korea1.jpg', 33, '- Meet and assist upon arrival and departure <br>\n- All Tour & transfer by Private Van <br>\n- Entrance Fees to sites as program <br>\n- English speaking Guide during tour in Korea <br>\n- 4 nights hotel accommodation on HB Basis <br>     \n- Meals follow as program <br>\n- Int. Flight with V class <br>\n', '- Visa <br>\n- Tax, Airport Tax <br>\n- Porterage at Airport & Hotel <br>\n- Tips to local guide :$45/ group/ day <br>\n- Tips to driver   : $30/group/day\n', '-', 'South Korea, officially the Republic of Korea, and commonly referred to as Korea, is a sovereign state in East Asia, constituting the southern part of the Korean Peninsula. The name Korea is derived from the Kingdom of Goryeo.'),
(27, 25, 'europe-riveria.jpg', 34, '-', '- Single Supplement: $ 375 per orang.<br>\n- Airport Tax International : $ 545 per orang (harga tax dapat berubah setiap saat tanpa pemberitahuan).<br>\n- Airport Tax Jakarta: Rp. 150.000,- per orang.<br>\n- Tipping yang diwajibkan untuk tour leader  2/orang/hari, local guide 2/orang/hari & driver 2/orang/hari.', '- ', 'Lourdes (Lorda dalam bahasa Occitan) adalah sebuah kota di departemen Hautes-Pyrnes di Perancis. Kota ini merupakan tempat ziarah agama Katolik terbesar di Perancis. Kota ini terletak di selatan Perancis di kaki pegunungan Pyrenees, dan memiliki 17.000 penduduk.'),
