(29, 26, 'europe-sebastian1.jpg', 35, '-', '- Single Supplement: $650 /orang<br>\n- Airport Tax Internasional & Fuel Surcharge : $ 435 per orang (harga tax dapat berubah setiap saat tanpa pemberitahuan).<br>\n- Airport Tax Jakarta Rp. 150.000,- per orang.<br>\n- Tipping yang diwajibkan untuk Tour Leader Euro 3/orang/hari, Local Guide Euro 2/orang/hari & Driver Euro 2/orang/hari.\nTOTAL TIPPING : EUR 56<br>\n- Visa Perancis.<br>\n- Travel Insurance ', '- ', 'San Sebastian merupakan kota yang terletak di sebelah utara Spanyol. Kota ini terletak di wilayah otonomi Pais Vasco.'),
(30, 27, 'europe-milan.jpg', 36, '-', '- Single Supplement: $ 600 per orang.<br>\n- Airport Tax International : $ 440 (EK) /$ 515 (TK), $355 (EY) per orang (harga tax dapat berubah setiap saat tanpa pemberitahuan).<br>\n- Airport Tax Jakarta: Rp. 150.000,- per orang.<br>\n- Tipping yang diwajibkan untuk tour leader  3/orang/hari, local guide 2/orang/hari & driver 2/orang/hari. TOTAL : EUR 60', '- ', 'Milan (Milano dalam bahasa Italia, dan Milan dalam dialek Milan, dari bahasa Latin, Mediolanum yang berarti di tengah hamparan) adalah kota utama di sebelah utara Italia, dan terletak di hamparan Lombardia, wilayah paling maju di Italia. '),
(31, 28, 'europe-zaanse.jpg', 37, '-', '- Single Supplement: $ 390 per orang.<br>\n- Airport Tax Internasional: $ 580 (SQ), $ 500 (TK) per orang (harga tax dapat berubah setiap saat tanpa pemberitahuan).<br\n- Airport Tax Jakarta: Rp. 150.000,- per orang<br>\n- Tipping yang diwajibkan untuk tour leader Eur 3/orang/hari, local guide Eur 2/orang/hari & driver Eur 2/orang/hari\nTOTAL TIPPING : EUR 33', '-', 'Zaanse Schans adalah lingkungan Zaandam , dekat Zaandijk di kotamadya Zaanstad di Belanda , di provinsi Belanda Utara .'),
(32, 29, 'europe-portugal.jpg', 38, '-', '- Single Supplement: $ 400 per orang.<br>\n- Airport Tax Internasional: $ 530 per orang (harga tax dapat berubah setiap saat tanpa pemberitahuan).<br>\n- Airport Tax Jakarta: Rp. 150.000,- per orang<br>\n- Tipping yang diwajibkan untuk Tour Leader Euro 3/orang/hari, Local Guide Euro 2/orang/hari & Driver Euro 2/orang/hari.', '-', 'Kordoba, juga dikenal sebagai Kordova (Bahasa Arab : ?????), adalah ibukota Provinsi Kordoba, Andalusia, Spanyol selatan. Kordoba terletak di sebelah Sungai Guadalquivir'),
(33, 30, 'amerika-alaska.jpg', 39, '-', '- Airport Tax Internasional & Fuel Surcharge: $ 385 per orang (harga tax dapat berubah setiap saat tanpa pemberitahuan).<br>\n- Cruise Tax & gratuities selama cruise berlangsung $ 535 per orang<br>\n- Airport Tax Jakarta Rp. 150.000,- per orang.<br>\n- Tipping yang diwajibkan untuk tour leader $3/orang/hari, driver $3/orang/hari. Total tipping : $78/orang<br>\n- Visa Canada Multiple<br>\n- Visa USA', '-', 'Alaska adalah daerah yang dibeli oleh pemerintah AS dari Kerajaan Rusia tanggal 30 Maret 1867sebesar $7,2juta. Dan pada tanggal 3 Januari 1959, resmi menjadi Negara bagian ke 49 dari AS.'),
(34, 31, 'amerika-canada.jpg', 40, '-', '- Single Supplement: $545 /orang <br>\n- Airport Tax Internasional & Fuel Surcharge: $505 (harga tax dapat berubah setiap saat tanpa pemberitahuan)<br>\n- Airport Tax Jakarta Rp. 150.000,- per orang.<br>\n- Tipping yang diwajibkan untuk tour leader $3/orang/hari, driver $3/orang/hari. (Total tipping : $63)<br>\n- Visa Canada<br>\n- Visa USA', '-', 'Liberty Enlightening the World, lebih dikenal dengan nama Statue of Liberty atau Patung Liberty dalam bahasa Indonesia, adalah suatu patung berukuran raksasa yang terletak di Pulau Liberty, di muara Sungai Hudson di New York Harbor, Amerika Serikat. Patung ini dihadiahkan Perancis untuk Amerika Serikat pada akhir abad ke-19 dan merupakan suatu simbol selamat datang untuk pengunjung, imigran dan orang Amerika yang kembali.'),
(35, 32, 'amerika-monterey.jpg', 41, '-', '- Single Supplement: $515/orang <br>\n- Airport Tax Internasional & Fuel Surcharge: $365 per orang (harga tax dapat berubah setiap saat tanpa pemberitahuan).<br>\n- Airport Tax Jakarta Rp. 150.000,- per orang.<br>\n- Tipping yang diwajibkan untuk Tour Leader $3/orang/hari, Driver $1/orang/hari (Total tipping : $42/orang)<br>\n- Visa USA', '-', 'Universal Studios Hollywood adalah sebuah studio film dan taman hiburan di masyarakat Universal City tak berhubungan kawasan San Fernando Valley kota Los Angeles , California , Amerika Serikat .'),
(36, 35, 'honeymoon_lombok.jpg', 42, '- 1 (satu) malam menginap di Senggigi Beach Area disertai makan pagi <br>\n- 1 (satu) malam menginap di Gili Trawangan Island disertai makan pagi<br>\n- 2 (dua) malam menginap di Kuta Bali disertai makan pagi<br>\n- Return Transfer (APT-HTL-APT)<br>\n- Air Conditioned Transport (Private Coach)<br>\n- Proffesional Indonesian Speaking Guide<br>\n- Tour as per itinerary<br>\n- Biaya masuk ke obyek wisata di Lombok, Donasi & Parkir<br>\n- BOAT CHARTER <br>\n- Makan siang di Local Resto (preferred) sesuai itinerary<br>\n- Makan malam di Local Resto (preferred) sesuai itinerary<br>\n- Refreshment (disposable cold face towel/wet tissue)<br>\n- Fresh Mineral Waters in (medium size) selama Tours<br>\n- Fresh Softdrinks in cold box selama Tours <br>\n- Kalungan Selendang  Tenun Songket pada saat kedatangan (Complimentary) <br>\n- Souvenir Lombok pada saat keberangkatan (Complimentary) <br>\n- Airport Handling on Departure', '- Tiket pesawat / Tiket Fast Boat<br>\n-  Airport Tax<br>\n- Porter Fee <br>\n- Personal expenses (i.e of Laundry, Telephone, mini bar and etc.) <br>\n- Guide & Driver Tipping', '-', 'Lombok dan Bali adalah Surganya Indonesia, dan sangat cocok menikmati keindahan alamnya bersama seseorang spesial di hidup Anda.'),
(37, 36, 'baru2.jpg', 43, '-', '- Tax & YQ<br>\n- Visa<br>\n- Full Surcharge & PPN 1%', '-', 'Shenzhen adalah sebuah kota District di selatan china yang termasuk dalam provinsi Guangdong , Shenzhen ini berbatasan langsung dengan salah satu kota metropolitan asia bahakn dunia yang pernah jadi Provinsi Kolonial Inggris yaitu Hongkong , maka tidak heran banyak warga Shenzhen yang berlibur ke Hongkong atau sebaliknya,.'),
(38, 37, 'baru3.jpg', 44, '- ', '- Tax & YQ<br> \n- Visa<br>\n- Full Surcharge & PPN 1%', '-', 'Ancient. Letaknya tidak jauh dari pusat kota. Bangunan kuno ini hanya dapat di lihat dari luar. Di depan bangunan ada satu kios tukang foto yang menyewakan baju China satu paket dengan fotonya layak untuk di coba. Pemandangan ke sungai juga bagus dan ada satu pohon yang katanya sudah berusia lebih dari 1000 tahun.'),
(39, 38, 'baru1.jpg', 45, '- ', '- Tax & YQ<br> \n- Visa<br> \n- Full Surcharge & PPN 1%', '-', 'Jepang adalah sebuah negara kepulauan di Asia Timur . Terletak di Samudra Pasifik , terletak di sebelah timur Laut Jepang , Cina , Korea Utara , Korea Selatan dan Rusia , yang membentang dari Laut Okhotsk di utara ke Laut Cina Timur dan Taiwan di selatan .'),
(40, 39, 'baru4.jpg', 46, '-', '- Tax & YQ<br> \n- Visa<br> \n- Full Surcharge & PPN 1%', '-', 'Keukenhof , juga dikenal sebagai Taman Eropa , adalah taman bunga terbesar kedua di dunia setelah Dubai Keajaiban Garden. Hal ini terletak di Lisse , Belanda'),
(41, 40, '7-asia.jpg', 47, '- Flight Ticket Cathay pacific JKT-HKG-JKT Economy Class based on N Class <br>\n- Return Airport  Hotel  Airport Transfer based on Seat in coach  Report at Counter A08 upon arrival <br>\n- 2 Nights Stay at Standard room in New World Millennium Hotel<br>\n- Disneyland/OceanPark ticket redeem at HKIA counter A08 upon arrival (No transportation provided)<br>\n- Travel Insurance', '- Fuel Surcharge + International Tax USD.60/pax (subject to change)<br>\n- Tips Bell Boy, Guide, Driver (if any)<br>\n- Travel Document (passport)<br>\n- Optional Tour & Meals<br>\n- Excess baggage', '- Booking Period until 30 April 2015<br>\n- Travel date until 30 June 2015<br>\n- Weekend Surcharge USD.30 per room per night<br>\n- Maximum 2A+1C sharing 1 room. Child Age refer to 2 -11 years old<br>\n- Ticket Cathay Pacific Based on N Class, with Validit', 'Hong Kong adalah kota yang terletak di bagian tenggara Tiongkok di Pearl River Estuari dan Laut Tiongkok Selatan. Hong Kong terkenal dengan perkembangannya yang ekspansif, pelabuhan laut dalam alami, dan kepadatan penduduk yang sangat tinggi'),
(42, 41, '8-asia.jpg', 48, '- Tiket penerbangan Garuda Indonesia, Economy Class berdasarkan  S  Class (Dengan GA 864/868)<br>\n- Bagasi : 30 Kg/Pax/Way ( sesuai peraturan penerbangan )<br>\n- Akomodasi *3 / *4 / * 5 (Twin/Triple) di Hotel pilihan<br>\n- Pengantaran dari Bandara  Hotel  Bandara ( SIC )<br>\n- Half Day Tour di Bangkok<br>\n- Local Guide Bahasa Indonesia / Melayu<br>\n- Asuransi Perjalanan', '- Tipping Tour Guide & Driver : USD 5/ hari / orang<br>\n- International TAXES USD 150/Pax ( Subject to Change )<br>\n- Tips Bell Boy Hotel, Porter Bandara<br>\n- Pengurusan Dokumen ( Passport )<br>\n- Optional Tour & makan<br>\n- Kelebhihan Bagasi', '- Reservasi dengan minimal UANG MUKA USD 200/ Orang dan dilengkapi SCAN PASSPORT<br>\n- Pembayaran Tipping & Airport Tax dibayarkan pada saat melakukan pelunasan ( Ke Dream Tour & Travel )<br>\n- Passport dibawa oleh masing-masing peserta pada saat keberang', 'Bangkok adalah ibu kota dan kota terbesar di Thailand. Kota ini terletak di tepi barat Sungai Chao Phraya, dekat Teluk Thailand.'),
(43, 42, '9-asia.jpg', 49, '- Tiket penerbangan Garuda Indonesia, Economy Class berdasarkan  S  Class (Dengan GA 864/868)<br>\n- Bagasi : 30 Kg/Pax/Way ( sesuai peraturan penerbangan )<br>\n- Akomodasi *3 / *4 / * 5 (Twin/Triple) di Hotel pilihan<br>\n- Pengantaran dari Bandara  Hotel  Bandara ( SIC )<br>\n- Half Day Tour di Bangkok<br>\n- Local Guide Bahasa Indonesia / Melayu<br>\n- Asuransi Perjalanan', '- Tipping Tour Guide & Driver : USD 5/ hari / orang<br>\n- International TAXES USD 150/Pax ( Subject to Change )<br>\n- Tips Bell Boy Hotel, Porter Bandara<br>\n- Pengurusan Dokumen ( Passport )<br>\n- Optional Tour & makan<br>\n- Kelebihan Bagasi', '- Reservasi dengan minimal UANG MUKA USD 200/ Orang dan dilengkapi SCAN PASSPORT<br>\n- Pembayaran Tipping & Airport Tax dibayarkan pada saat melakukan pelunasan ( Ke Dream Tour & Travel )<br>\n- Passport dibawa oleh masing-masing peserta pada saat keberang', 'Bangkok adalah ibu kota dan kota terbesar di Thailand. Kota ini terletak di tepi barat Sungai Chao Phraya, dekat Teluk Thailand.'),
(44, 43, '10-asia.jpg', 50, '- Tiket penerbangan GARUDA INDONESIA, Economy Class Berdasarkan S Class<br>\n- Akomodasi di Hotel Sesuai Pilihan Setaraf *3 atau *4<br>\n- Pengantaran dari Bandara Ke Hotel, Hotel ke Bandara ( SIC )<br>\n- Bonus City Tour Setiap Hari Sabtu Mulai Pukul 09.00 Sampai dengan 17.00<br>\n- Kaboom Show ( USD 50/pax )<br>\n- Makan Pagi di Hotel', '- International Tax USD 100/Pax ( Dapat Berubah Sewaktu-waktu )<br>\n- Airport Tax Jakarta IDR 150.000/Pax<br>\n- Tipping Tour Guide & Driver : USD 5/pax/day<br>\n- Pengurusan Dokumen ( Passport, Visa Korea)<br>\n- Optional Tour<br>\n- Pengeluaran Pribadi<br>\n- Upgrade Class Tiket Garuda<br>\n- Asuransi Perjalanan', '- Reservasi dilengkapi SCAN PASSPORT & Uang Muka MINIMAL USD 300/PAX<br>\n- Pembayaran Tipping dibayarkan pada saat melakukan pelunasan ( Ke Dream Tour & Travel )<br>\n- Passport dibawa oleh masing-masing peserta pada saat keberangkatan<br>\n- Pelunasan pali', 'Korea adalah sebuah semenanjung yang di Asia Timur. Korea terbagi menjadi dua negara, yakni Republik Korea dan Republik Rakyat Demokratik Korea setelah Perang Dunia II pada tahun 1945.'),
(45, 44, '11-asia.jpg', 51, '- Tiket penerbangan Air Asia, Economy Class, Bagasi : 20 Kg/Pax/Way ( sesuai peraturan penerbangan )<br>\n- Akomodasi *3 (Twin/Triple) ( Sesuai dengan Program )<br>\n- Tour dan Makan sesuai program ( Sesuai dengan Program )<br>\n- Fuel Surcharge, Tax Int, Airport Tax Jakarta<br>\n- Indonesia speaking guide<br>\n- VIA Group Handling<br>\n- Asuransi Perjalanan', '- Tipping Tour Guide & Driver<br>\n- Tips Bell Boy Hotel, Porter Bandara<br>\n- Pengurusan Dokumen ( Passport )<br>\n- Optional Tour & makan<br>\n- Kelebihan Bagasi', '- Uang Muka Rp. 2.500.000/ Pax ( Non Refundable ) pada saat Booking dilengkapi DATA PASSPORT<br>\n- Pembayaran Tipping & Airport Tax dibayarkan pada saat melakukan pelunasan ( Ke Dream Tour & Travel)<br>\n- Perjalanan ini TIDAK didampingi Tour Leader<br>\n- ', 'Bangkok adalah ibu kota dan kota terbesar di Thailand. Kota ini terletak di tepi barat Sungai Chao Phraya, dekat Teluk Thailand.'),
(46, 45, '12-asia.jpg', 52, '- Tiket  penerbangan Air Asia, Economy Class, \nBagasi : 20 Kg/Pax/Way ( sesuai peraturan penerbangan ) <br>\n- Akomodasi *3 (Twin/Triple) <br>\n- Tour dan Makan sesuai program <br>\n- Fuel Surcharge, Tax Int <br>\n- Indonesia speaking guide <br>\n- VIA Group Handling <br>\n- Asuransi Perjalanan dengan Assist Card <br>\n', '- Airport Tax Jakarta IDR 150.000/Pax <br>\n- Tipping Tour Guide & Driver : USD 12/ pax <br>\n- Tips Bell Boy Hotel, Porter Bandara <br>\n- Pengurusan Dokumen ( Passport ) <br>\n- Optional Tour & makan <br>\n- Kelebihan Bagasi <br>\n', '1.	Uang Muka Rp. 2.500.000/ Pax ( Non Refundable ) pada saat Booking dilengkapi DATA PASSPORT  \n(Pendaftaran tanpa uang muka, sewaktu-waktu dapat diberikan ke pendaftar lain tanpa pemberitahuan terlebih dahulu ) <br>\n2.	Pembayaran Tipping & Airport Tax dibayarkan pada saat melakukan pelunasan ( Ke Dream Tour & Travel ) <br>\n3.	Perjalanan ini TIDAK  didampingi Tour Leader <br>\n4.	Passport dibawa oleh masing-masing peserta pada saat keberangkatan  <br>\n5.	Pelunasan paling lambat 15 hari sebelum tanggal keberangkatan <br>\nJika Booking kurang dari 2 Minggu sebelum keberangkatan maka pelunasan Maksimum 3 Hari \n( Hari Kerja ) setelah Deposit <br>\n6.	Biaya Pembatalan : <br>\n	Pembatalan setelah Deposit sampai dengan 15 Hari sebelum pemberangkatan : Deposit Hangus <br>\n	2 Minggu Sebelum pemberangkatan : 75% / pax dari total harga paket <br>\n	1 Minggu Sebelum pemberangkatan : 100% / Pax ( Full Payment ) <br>\n7.	Pembatalan peserta bisa di Ganti Nama dengan peserta lain Maksimum 7 hari (hari kerja) sebelum keberangkatan dengan biaya Rp. 500.000/Orang\nTidak Ada PENGEMBALIAN UANG Untuk Paket Perjalanan Yang DIBATALKAN Atau DIUBAH Atas Permintaan Customer <br>\n8.	TIDAK ADA PENGEMBALIAN UANG UNTUK PAKET PERJALANAN YANG DIBATALKAN ATAU DIUBAH ATAS PERMINTAAN CUSTOMER <br>\n9.	Final Confirmation & Hal- hal yang harus diperhatikan, akan dibagikan maksimal 3 hari sebelum keberangkatan <br>\n', 'Pattaya is a town on Thailands eastern Gulf coast known for a wild nightlife scene that attracts international visitors, weekenders from Bangkok and expats'),
(47, 46, '13-asia1.jpg', 53, '- Tiket  penerbangan Cathay Pacific, Economy Class, \nBagasi : 30 Kg/Pax/Way <br>\n- Akomodasi *4 (Twin/Triple)  <br>\n- Tour dan Makan sesuai program <br>\n- Indonesia speaking guide <br>\n- Tour Leader dari Indonesia <br>\n- VIA Group Handling <br>\n- Asuransi Perjalanan\n', '- Fuel Surcharge, Tax International USD.70/pax (subject to change)\n- Tipping TL, Tour Guide & Driver : USD 5/pax/day\n- Tips Bell Boy Hotel, Porter Bandara\n- Pengurusan Dokumen (Passport, Visa China) \n- Optional Tour & makan\n- Kelebihan Bagasi\n', '1.	Grup akan diberangkatkan apabila jumlah peserta mencapai minimum 20 orang dewasa/group <br>\n2.	Uang Muka USD.300/ Pax (Non Refundable) pada saat booking dilengkapi data passport calon peserta (Pendaftaran tanpa uang muka, sewaktu-waktu dapat diberikan ke pendaftar lain tanpa pemberitahuan terlebih dahulu ) <br>\n3.	Biaya Pembatalan : <br>\nSetelah Deposit dilakukan  <br> \no	15 Hari sebelum pemberangkatan : 50%  dari harga paket per orang  <br> \no	2 Minggu Sebelum pemberangkatan : 75% dari harga paket per orang  <br>\no	1 Minggu Sebelum pemberangkatan : 100% dari harga paket per orang <br>\n4.	Pembayaran Tipping & Airport Tax dibayarkan pada saat melakukan pelunasan ke (Dream Tour & Travel) <br>\n5.	Perjalanan ini tidak didampingi Tour Leader apabila total peserta kurang dari 15 Orang. <br>\n6.	Passport dibawa oleh masing-masing peserta pada saat keberangkatan  <br>\n7.	Pelunasan paling lambat 15 hari sebelum tanggal keberangkatan, Jika Booking kurang dari 2 Minggu sebelum keberangkatan maka pelunasan Maksimum 3 Hari (Hari Kerja) setelah Deposit. <br>\n8.	Final Confirmation & Hal- hal yang harus diperhatikan, akan dibagikan maksimal 3 hari sebelum keberangkatan  <br>\n9.	Tidak ada pengembalian uang untuk paket perjalanan yang dibatalkan atau diubah atas permintaan customer  <br>\n10.	Dalam keadaan Force Majeur/Situasi yang membahayakan/Kerusuhan yang mengancam keselematan peserta, jadwal sewaktu-waktu dapat berubah tanpa pemberitahuan terlebih dahulu, hal-hal yang dilakukan demi kepe', 'Beijing, sometimes romanized as Peking, is the capital of the People''s Republic of China and one of the most populous cities in the world'),
(48, 47, '14-asia.jpg', 54, '- Tiket  penerbangan Cathay Pacific, Economy Class\nBagasi: 30 Kg/Orang/Jalan <br>\n- Akomodasi sesuai pilihan hotel (Twin/Triple)  <br>\n- Tour dan Makan sesuai program <br>\n- Indonesia speaking guide <br>\n- Tour Leader dari Indonesia <br>\n- VIA Group Handling <br>\n- Asuransi Perjalanan\n', '- Fuel Surcharge, Tax International USD.60/pax (subject to change) <br>\n- Tipping TL, Tour Guide & Driver : USD 7/pax/day <br>\n- Tips Bell Boy Hotel, Porter Bandara <br>\n- Pengurusan Dokumen (Passport) <br>\n- Optional Tour & makan <br>\n- Kelebihan Bagasi ', '1.	Grup akan diberangkatkan apabila jumlah peserta mencapai minimum 15 orang dewasa/group <br>\n2.	Uang Muka USD.300/ Pax (Non Refundable) pada saat booking dilengkapi data passport calon peserta (Pendaftaran tanpa uang muka, sewaktu-waktu dapat diberikan ke pendaftar lain tanpa pemberitahuan terlebih dahulu ) <br>\n3.	Biaya Pembatalan : <br>\nSetelah Deposit dilakukan <br>\no	15 Hari sebelum pemberangkatan : 50%  dari harga paket per orang <br>\no	2 Minggu Sebelum pemberangkatan : 75% dari harga paket per orang  <br>\no	1 Minggu Sebelum pemberangkatan : 100% dari harga paket per orang <br>\n4.	Pembayaran Tipping & Airport Tax dibayarkan pada saat melakukan pelunasan. <br>\n5.	Perjalanan ini tidak didampingi Tour Leader apabila total peserta Hanya 15 Orang. <br>\n6.	Passport dibawa oleh masing-masing peserta pada saat keberangkatan <br>\n7.	Pelunasan paling lambat 15 hari sebelum tanggal keberangkatan, Jika Booking kurang dari 2 Minggu sebelum keberangkatan maka pelunasan Maksimum 3 Hari (Hari Kerja) setelah Deposit. <br>\n8.	Final Confirmation & Hal- hal yang harus diperhatikan, akan dibagikan maksimal 3 hari sebelum keberangkatan <br>\n9.	Tidak ada pengembalian uang untuk paket perjalanan yang dibatalkan atau diubah atas permintaan customer <br>\n10.	Dalam keadaan Force Majeur/Situasi yang membahayakan/Kerusuhan yang mengancam keselematan peserta, jadwal sewaktu-waktu dapat berubah tanpa pemberitahuan terlebih dahulu, hal-hal yang dilakukan demi kepentingan keamanan seluruh peserta. Dream tidak bertanggung jawab dalam pengembalian biaya atau uang atas service yang sudah dibayarkan dan tidak dgunakan serta biaya tambahan yang muncul dikarenakan hal tersebut diatas.\n', 'Shenzhen is a major city in the south of Southern Chinas Guangdong Province, situated immediately north of Hong Kong Special Administrative Region'),
(49, 48, '15-asia.jpg', 55, '- Tiket  penerbangan GARUDA INDONESIA,  \nEconomy Class Berdasarkan  S Class \nBagasi : 30 Kg/Pax/Way ( sesuai peraturan penerbangan ) <br>\n Akomodasi di Hotel Sesuai Pilihan Setaraf *3 atau *4 \n- Tour SIC ( Seat In Coach  ) Dengan Guide Berbahasa Inggris <br>\n- Makan sesuai program \n', '- International Tax USD 100/Pax  ( Dapat Berubah Sewaktu-waktu ) <br>\n- Airport Tax Jakarta IDR 150.000/Pax <br>\n- Tipping Tour Guide & Driver : USD 5/pax/day <br>\n- Pengurusan Dokumen ( Passport, VISA ) <br>\n- Optional Tour  <br>\n- Pengeluaran Pribadi <br>\n- Asuransi Perjalanan\n', '1.	Reservasi dilengkapi SCAN  PASSPORT  & Uang Muka Minimum USD 300/pax.\n(Pendaftaran tanpa uang muka, sewaktu-waktu dapat diberikan ke pendaftar lain tanpa pemberitahuan terlebih dahulu )  <br>\n2.	Pembayaran Tipping dibayarkan pada saat melakukan pelunasan ( Ke Dream Tour & Travel )  <br>\n3.	Passport dibawa oleh masing-masing peserta pada saat keberangkatan <br>\n4.	Pelunasan paling lambat 15 hari sebelum tanggal keberangkatan \nJika Reservasi kurang dari 2 Minggu sebelum keberangkatan maka pelunasan  Maksimum 3 Hari  ( Hari Kerja ) setelah Deposit /Reservasi Konfirm <br>\n5.	Biaya Pembatalan : <br>\n       Pembatalan setelah Deposit sampai dengan 15 Hari sebelum pemberangkatan dikenakan biaya pembatalan USD 300  <br>\n       Pembatalan Setelah Deposit sampai  dengan  7 Hari Sebelum keberangkatan :  75 % dari Total Tagihan <br>\n       Pembatalan Setelah Deposit sampai dengan  3 Hari Sebelum Keberangkatan : 100 % dari Total Tagihan <br>\n6.	Setiap peserta diwajibkan untuk mengikuti dan memasuki tempat perbelanjaan yang dituju dan ditunjuk oleh pemerintah korea, bilamana peserta tidak bersedia untuk mengikuti dan memasuki tempat ini maka peserta akan dikenakan pembebanan biaya extra sebesar : Ginseng Shop, Amethyst Shop: USD 100 Per Orang <br>\n7.	Final Confirmation & Hal-hal yang harus diperhatikan, akan diberikan maksimal 3 hari sebelum keberangkatan  <br>\n8.	Biaya Tambahan per orang untuk  Upgrade dari S Class ke : <br>\nV Class  = USD 280/orang <br>\nT Class = USD 340/orang <br>\nQ Class = USD 380/orang <br>\n9.	Harga Paket Tidak Berlaku Pada Periode 1  6 April ( Easter ), 1-5 May ( Golden Week )  <br>\n10.	TIDAK ADA PENGEMBALIAN UANG UNTUK PAKET PERJALANAN YANG DIBATALKAN ATAU DIUBAH ATAS PERMINTAAN CUSTOMER\n', '-'),
(50, 49, '16-asia.jpg', 56, '- Tiket  penerbangan Vietnam Airlines, Economy Class, \nBagasi : 20 Kg/Orang/Jalan ( sesuai peraturan penerbangan ) <br>\n- Airport Tax Jakarta <br>\n- Akomodasi *3 (Twin/Triple) <br>\n- Tour dan Makan sesuai program <br>\n- Air Mineral ( 02 Botol / Hari / Orang Dewasa ) dan \nFresh Tissue ( 02 Macam / Hari / Orang Dewasa ) <br>\n- Tour Leader dari Jakarta <br>\n- Local Guide Berbahasa Inggris / Indonesia, di Saigon dan Berbahasa Inggris di Hanoi  Halong <br>\n- VIA Group Airport Handling <br>\n- Asuransi Perjalanan <br>\n- Travelling Kits\n', '- International Tax USD 185 / Orang\n( *Harga bisa berubah sewaktu-waktu ) <br>\n- Tipping Tour Guide & Driver : USD 25/ Orang <br>\n- Tips Bell Boy Hotel, Porter Bandara <br>\n- Pengurusan Dokumen ( Passport ) <br>\n- Optional Tour & makan <br>\n- Kelebihan Bagasi ', '- Uang Muka USD 300/ Pax ( Non Refundable ) pada saat Reservasi dilengkapi DATA PASSPORT  \n(Pendaftaran tanpa uang muka, sewaktu-waktu dapat diberikan ke pendaftar lain tanpa pemberitahuan terlebih dahulu ) <br>\n- Pembayaran Tipping dibayarkan pada saat melakukan pelunasan ( Ke Dream Tour) \n<br>- Passport diserahkan ke kantor Via Indonesia, hal ini diperlukan untuk <br>mempermudah proses Airport Handling  \n- Pelunasan paling lambat 15 hari sebelum tanggal keberangkatan <br>\nJika Booking kurang dari 2 Minggu sebelum keberangkatan maka pelunasan Maksimum 3 Hari \n( Hari Kerja ) setelah Deposit <br>\n- Biaya Pembatalan : <br>\n	Pembatalan setelah Deposit sampai dengan 15 Hari sebelum pemberangkatan : Deposit Hangus USD 300 <br>\n	2 Minggu Sebelum pemberangkatan : 75% / pax dari total harga paket <br>\n	1 Minggu Sebelum pemberangkatan : 100% / Pax ( Full Payment ) <br>\n- TIDAK ADA PENGEMBALIAN UANG UNTUK PAKET PERJALANAN YANG DIBATALKAN ATAU DIUBAH ATAS PERMINTAAN CUSTOMER <br>\n- Final Confirmation & Hal- hal yang harus diperhatikan, akan dibagikan maksimal 3 hari sebelum keberangkatan <br>\n', 'Vietnam is a Southeast Asian country on the South China Sea known for its beaches, rivers, Buddhist pagodas and bustling cities.'),
