(56, 54, '21-asia.jpg', 61, '- Tiket  penerbangan Cathay Pacific, Economy Class, \nBagasi : 30 Kg/Pax/Way <br>\n- Akomodasi *4 (Twin/Triple) <br>\n- Tour dan Makan sesuai program <br>\n- Indonesia speaking guide <br>\n- Tour Leader dari Indonesia <br>\n- VIA Group Handling  <br>\n- Asuransi Perjalanan <br>\n', '- Fuel Surcharge, Tax International USD.70/pax (subject to change) <br>\n- Tipping TL, Tour Guide & Driver : USD 5/pax/day <br>\n- Tips Bell Boy Hotel, Porter Bandara <br>\n- Pengurusan Dokumen (Passport, Visa china)  <br>\n- Optional Tour & makan <br>\n- Kelebihan Bagasi  <br>', '1.	Grup akan diberangkatkan apabila jumlah peserta mencapai minimum 20 orang dewasa/group <br>\n2.	Uang Muka USD.300/ Pax (Non Refundable) pada saat booking dilengkapi data passport calon peserta (Pendaftaran tanpa uang muka, sewaktu-waktu dapat diberikan ke pendaftar lain tanpa pemberitahuan terlebih dahulu ) <br>\n3.	Biaya Pembatalan : <br>\nSetelah Deposit dilakukan <br>\no	15 Hari sebelum pemberangkatan : 50%  dari harga paket per orang <br>\no	2 Minggu Sebelum pemberangkatan : 75% dari harga paket per orang <br>\no	1 Minggu Sebelum pemberangkatan : 100% dari harga paket per orang <br>\n4.	Pembayaran Tipping & Airport Tax dibayarkan pada saat melakukan pelunasan ke (Dream Tour & Travel)  <br>\n5.	Perjalanan ini tidak didampingi Tour Leader apabila total peserta kurang dari 15 Orang. <br>\n6.	Passport dibawa oleh masing-masing peserta pada saat keberangkatan <br>\n7.	Pelunasan paling lambat 15 hari sebelum tanggal keberangkatan, Jika Booking kurang dari 2 Minggu sebelum keberangkatan maka pelunasan Maksimum 3 Hari (Hari Kerja) setelah Deposit. <br>\n8.	Final Confirmation & Hal- hal yang harus diperhatikan, akan dibagikan maksimal 3 hari sebelum keberangkatan <br>\n9.	Tidak ada pengembalian uang untuk paket perjalanan yang dibatalkan atau diubah atas permintaan customer <br>\n10.	Dalam keadaan Force Majeur/Situasi yang membahayakan/Kerusuhan yang mengancam keselematan peserta, jadwal sewaktu-waktu dapat berubah tanpa pemberitahuan terlebih dahulu, hal-hal yang dilakukan demi kepentingan keamanan seluruh peserta. Via tidak bertanggung jawab dalam pengembalian biaya atau uang atas service yang sudah dibayarkan dan tidak dgunakan serta biaya tambahan yang muncul dikarenakan hal tersebut diatas. <br>\n', 'Beijing, Chinas massive capital, has history stretching back 3 millennia.'),
(57, 55, 'turkey-asia.jpg', 62, '- Tiket Pesawat P/P Jakarta  Istanbul  Jakarta by Turkish Airlines <br>\n- Visa Turkey <br>\n- Hotel bintang 5 / setaraf  <br>\n- Driver dan transportasi (bus) dengan AC dan WI-FI <br>\n<br> Makan/minum 3x sehari sesuai program <br>\n- Local guide berbahasa Indonesia <br>\n- Tiket masuk objek wisata <br>\n- 1 botol air mineral selama perjalanan di bus <br>', '- Kelebihan Bagasi sesuai Ketentuan Penerbangan <br>\n- Airport tax <br>\n- Tour/Makan/Minum tambahan diluar <br>\n- Telephone Bill, Payview TV, Mini Bar, dan semua pemakaian fasilitas/layanan di Hotel <br>\n- Biaya  biaya yang bersifat pribadi <br>\n- Tipping local guide dan driver', '- Paspor dengan masa berlaku tidak kurang dari 8 Bulan sebelum Jadwal keberangkatan Paspor dengan masa berlaku tidak kurang dari 8 Bulan sebelum Jadwal keberangkatan <br>\n- Nama kedua orang tua <br>\n- Alamat lengkap terakhir <br>\n- Pendaftaran disertai dengan Deposit minimum USD. 800, dengan pelunasan biaya paket \n\nmaksimal 3 (tiga) minggu sebelum jadwal keberan', 'Turkey is a nation straddling eastern Europe and western Asia with cultural connections to ancient Greek, Persian, Roman, Byzantine and Ottoman empires.');
